import React from 'react';

const Navbar = () => {
  return (
    <div className='navbar'>
      <p className='navbar__title'><strong>Freelancer</strong> portfolio</p>

      <ul class="navbar__list">
        <li className='navbar__li'>Projects</li>
        <li className='navbar__li'>Skills</li>
        <li className='navbar__li'>Contacts</li>
      </ul>
    </div>
  )
}
export default Navbar
